import React, { useState } from 'react';
import { InputBase, Typography } from '@material-ui/core';

export default function Title(){
    const[open,setOpen] = useState(false);
    return(
        <div>
            {open ? (
                <div>
                <InputBase value="Todo" />
                </div>

            ) : (
                <div>
                <Typography>Todo</Typography>
                </div>

            )   }   
           
        </div>
    );
}
